import styled from 'styled-components'
import { Content, Column, Paragraph } from '../components/Components'

const Footer = ({ styles }) => {
  return (
    <Wrap background={styles.palette.greens.g5} padding={styles.paddings.p1}>
      <Content>
        <Column>
          <Paragraph
            style={{ marginTop: '30px', textAlign: 'right' }}
            size={styles.paragraphs.p1}
            color={styles.palette.whites.w1}>
            Site réalisé par Baptiste DAUPHOUY pour le Crédit Agricole de
            Pontchâteau.
          </Paragraph>
        </Column>
        <Column></Column>
      </Content>
    </Wrap>
  )
}

const Wrap = styled.footer`
  height: 200px;
  display: flex;
  justify-content: center;
  background: ${props => props.background};
`

export default Footer
